int main(void)
{
	// Setup interrupts
	disable_A9_interrupts (); // disable interrupts in the A9 processor
	set_A9_IRQ_stack (); // initialize the stack pointer for IRQ mode
	config_GIC (); // configure the general interrupt controller
	config_KEYs (); // configure KEYs to generate interrupts
	config_TIMER ();
	enable_A9_interrupts (); // enable interrupts in the A9 processor
	
	// Setup VGA pixel buffer 
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	
	// Setup character buffer 
	volatile int* character_ctrl_ptr = (int*)0xFF203030;
	character_buffer_start  = *character_ctrl_ptr;
	
    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the back buffer
	/* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen(); // pixel_buffer_start points to the pixel buffer
	
	// Make sure that globals are reset
	x_position_bowser = RESOLUTION_X;
	x_pos_bg_1 =0; 
	x_pos_bg_2 = RESOLUTION_X; 
	
	int i = 0;
	volatile int *hex1 = (int*) 0xFF200020;
	volatile int *hex2 = (int*) 0xFF200030;
	
	//set random seed 
	time_t t;
  	srand((unsigned) time(&t));
	
	set_random_coin_pos(); 
	//display the high score on the hex, currently is 0
	display_highscore_hex();
	
	//Main function of the game
	while (1) // wait for an interrupt
	{
		clear_screen();
		
		// add game start logic
		
		if(!gameover && !boolstart) //if the game is running
		{
			
			draw_score(); //draw score
			draw_background(27, 340, background, x_pos_bg_1);
			draw_background(27,340, background, x_pos_bg_2);
			//erase_image(b_size, x_position_bowser+2, BOWSER_Y);
			check_coin_collision(); //check if collected coin
			check_bowser_collision(); //check if collided with bowser
			draw_image(y_size, yoshi, YOSHI_X, y_pos_yoshi); //draw the character
			draw_image(c_size, coin, x_pos_coin, y_pos_coin);  //draw the coin
			draw_image(b_size, bowser, x_position_bowser, BOWSER_Y); //draw bowser
		}
		else if (gameover)  //if the game is over
		{
			erase_score(); //erase the coins in the top right
			draw_endscreen_final_score(); //display final score
			
			//check the score if it is a highscore to display on hex
			display_highscore_hex(); //update and display the highscore on the hexadecimal
			gameover_screen(); //display the gameover screen
		}
		else if(boolstart) //if the game is at the start page
		{
			if(draworexit_help==1){ //if key2 has been pressed to display the help screen
				help_screen(); //display help screen
			}else{ //otherwise
				erase_score(); //erase any score drawn on the screen
				erase_endscreen_final_score();
				score = 0; //reset the score to 0
				start_screen(); //draw the start screen image
			}

		}
		
		//This code is for displaying the highscore on the 7-segment display
		*hex1 = (highScore[i+2]<<24)|(highScore[i+3]<<16)|(highScore[i+4]<<8)|(highScore[i+5]);
		*hex2 = (highScore[i]<<8)|(highScore[i+1]);
		//control the speed of the moving display 
		if(increment>16)
		{
			if(i==17) 
				i = 0; 
			else 
				i++; 
			increment = 0; 
		}
		
		//wait and swap buffers
		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // update pointer to memory where u draw the next image -> get from dma controller
		
	}
}

